import React from 'react'
import { useParams } from 'react-router-dom';
const NotePage = ({ match }) => {
    const { params } = useParams();
    let noteId  = match.params.id 
  return (
    <div>
        <h1>Single note {noteId}</h1>
    </div>
  )
}

export default NotePage
